import React from 'react';
import './footer.css';
import CardFooter from './card_footer';
import CustomerCare from './customerCare';
import IconFooter from './iconFooter'
import Title from '../../general/title/title'

class Footer extends React.Component {
   render() {
      return (
        <div id="footer" className="container-fluid">
            <IconFooter/>
            <Title logo_head="Flash Box"
            slogan="We are Courier company that provides fast and reliable package transport."/>
            <CustomerCare/>
            <div className="col-12 rights text-center mt-4 mb-2">
              <span>Copyright &#169; 2021. All rights reserved.</span>
            </div>
          </div>
      );
   }
}
export default Footer;
